import React, {Component} from 'react';

class Event extends Component {  
    constructor(){
        super(props);
    }
    render(){
        return(
            <div className="Event">
                <h2>{this.props.event.name.text}</h2>
                <img src={this.props.event.logo.url}/>
                <p>{this.props.event.description.text}</p>
            </div>
        )
    }
}

export default Event;
